import React from 'react';
import Image from "./blogging.svg";

const Home =() => {
	return ( 
		<>
<div className="container-fluid nav_bg">
  <div className="row">
    <div className="col-10 mx-auto my-5">
    <div className="row">
          <div className="col-md-6 order-md-2 order-sm-1 text-white">
    
    <h1 className="display-4">Feel free to connect with <strong className="brand-name">Audonix</strong></h1><br />
    <p className="lead">This is a modified jumbotron that occupies the entire horizontal space of its parent.</p>
    <button type="button" className="btn btn-outline-light rounded-pill">Get started</button>
    
    </div>
    </div>


        
    <div className="col-md-6 order-md-1 order-sm-2"><img src={Image} className="img-fluid" alt="" alt="home img" /></div>
    
    </div>
  </div>
</div>

		
		
			
		</>
		);
};

export default Home;
